import React, { Component } from 'react';
import  { product } from './Product.json';
console.log(product);

class InvoiceMidddle extends Component{
    constructor(){
super();
this.state = {
    titulo: 'aplicacion',
    ntares : 10

}

    }


    render(){
      return(     


        <div className="middle">
        <table className="table ">
        <thead>
          <tr>
            <th>PRODUCT</th>
            <th>UNIT</th>
            <th>PRICE</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Espresso <span className="descript">(Large)</span></td>
            <td>1</td>
            <td>2.90</td>
          </tr>
          <tr>
            <td>Cappuccino <span className="descript">(small)</span></td>
            <td>2</td>
            <td>7.00</td>
          </tr>
          <tr>
            <td>Total</td>
            <td></td>
            <td>9.90</td>
          </tr>
        </tbody>
      </table>
      </div>
       
        );  
    }
}
export default InvoiceMidddle;
